import React from "react";
import { Link } from "react-router-dom";

const LandingPage = () => {
  return (
    <div className="min-h-screen bg-[#FFF7F0] flex flex-col justify-between">
      {/* Top Navigation */}
      <div className="w-full flex justify-end p-6">
        <Link to="/login" className="text-[#F97316] font-semibold hover:underline">
          Log in
        </Link>
      </div>

      {/* Main Content */}
      <div className="flex flex-col-reverse md:flex-row items-center justify-center px-6 md:px-20 gap-10 md:gap-24 flex-grow">
        {/* Text Section */}
        <div className="text-center md:text-left">
          <h1 className="text-5xl md:text-6xl font-extrabold text-[#F97316] leading-tight mb-6">
            MUNCH<br />MATCH
          </h1>
          <Link
            to="/signup"
            className="inline-block bg-[#F97316] text-white font-semibold rounded-full px-6 py-2 text-sm hover:bg-[#ea580c] transition"
          >
            Create account
          </Link>
        </div>

        {/* Image */}
        <div>
          <img
            src="/munch.png" // Replace with your actual image path
            alt="Burger and Fries"
            className="w-64 md:w-80"
          />
        </div>
      </div>

      {/* Optional footer or empty space to center content */}
      <div className="h-16" />
    </div>
  );
};

export default LandingPage;
